import React from 'react';
import '../Styles/pagina-inicial.css';
import { Link } from 'react-router-dom';
import logo from '../logo.png';
import { Stack, Button } from '@mui/material';

function PaginaInicial() {
  return (
    <div>
      <h1>Pet Cemetery</h1>
      <img src={logo} alt="logo" className='logoImg'></img>
      <p>Faça login ou crie uma conta para começar a alugar jazigos para animais.</p>
      <Stack spacing={2} direction='column'>
        <Button variant="contained">Quem somos</Button>
        <Button variant="contained">Conheça nossos planos</Button>
        <Button variant="contained">Contato</Button>
      </Stack>
      <Button variant="contained">Entrar</Button>
      <Button variant="contained">Cadastrar</Button>
    </div>
  );
}

export default PaginaInicial;
